// src/components/NotFound.js
import React from 'react';
import './NotFound.css';

function NotFound() {
    return (
        <div className="not-found">
            <h1>Página Não Encontrada</h1>
            <p>Ops! A página que você está procurando não existe.</p>
        </div>
    );
}

export default NotFound;
